import React from "react";
import { useAuth } from "../utils/use-auth.js";

export const Home = () => {
  const auth = useAuth();
  return (
    <div>
      <h2>
        {auth.user ? "Logged in as: " + auth.user.email : "Not logged in."}
      </h2>
      <br />
      <button
        onClick={() => {
          // call logout
          auth.logout();
        }}
      >
        Logout
      </button>
    </div>
  );
};

